import React from 'react';
import {
  MDBBtn,
  MDBNavbarLink
} from 'mdb-react-ui-kit';

export default function Header() {

  return (
    <header>

      <div
        id='intro-example'
        className='p-5 text-center bg-image'
        // style={{ backgroundImage: "url('https://images.squarespace-cdn.com/content/v1/630f6f1e9677196e0a55d0f9/dc0b277c-ef52-4867-a054-032db35b033e/Light+Objects+2.jpg?format=2500w')",   height: 500}}
        // style={{ backgroundImage: "url('https://images.squarespace-cdn.com/content/v1/5f834a0c50899866fcb93a61/1602684784605-ADM8WGC8QB8A6Y3YB2I7/AdobeStock_207911925+%281%29.jpeg')",   height: 500}}
        // style={{ backgroundImage: "url('https://img.freepik.com/premium-photo/concept-nail-care-with-manicure-accessories-white-background_185193-73756.jpg?w=2000')",   height: 500}}
        // style={{ backgroundImage: "url('https://classpass-res.cloudinary.com/image/upload/f_auto/q_auto/wlpkpipgf9q42hwidc9c.jpg')",   height: 500}}
        style={{ backgroundImage: "url('https://c0.wallpaperflare.com/preview/874/868/836/pink-and-clear-labeled-bottle.jpg')",   height: 500}}


      >
        <div className='mask'>
          <div className='d-flex justify-content-center align-items-center h-100'>
            <div className='text-black'>
              <h1 className='mb-3'>Welcome</h1>
              <h3>We offer the highest level of services to our clients</h3>
              <h5 className='mb-4'>Browse our services and make an appointment today</h5>
              <MDBNavbarLink >
              <MDBBtn
                outline rounded className='mx-2' color='dark'
                href='services'
              >
                Services
              </MDBBtn>
              <MDBBtn
                outline rounded className='mx-2' color='dark'
                href='contacts'
              >
                Contact
              </MDBBtn>
              </MDBNavbarLink>

            </div>
          </div>
        </div>
      </div>
    </header>
  );
}
